import React from 'react'

const Footer = () => {
    return (
        <div className='bg-gray-900 p-12'>
            <div className='container mx-auto text-center font-normal text-white'>&copy;{' '} 2020 MeConta: {' '} Todos os Direitos reservados<br/>
            <a className='hover:underline font-bold text-yellow-500' >EOS CREATIVE TECHNOLOGIE</a>
            </div>
        </div>
    )
}
export default Footer
